import fg from "fast-glob"
import Gallery from "../components/Gallery"

export default function Home({ posts }) {
  return (
    <Gallery posts={posts}/>
  );
}

export async function getStaticProps() {
  const files = await fg([
    `${process.cwd()}/gallery/inspo/*`,
    ])
  console.log(files)

  return {
    props: {
      files,
    },
  };
}
